import React, { Component } from 'react'
import { PageHeader, Button, Table, Modal, Space } from 'antd'

const columns = [
    {
        title: '编号',
        dataIndex: 'carriageNumber',
        key: '1',
        align: 'center',
    },
    {
        title: '级别',
        dataIndex: 'level',
        key: '2',
        align: 'center',
    },
    {
        title: '规格',
        dataIndex: 'size',
        key: '3',
        align: 'center',
    },
    {
        title: '座位数',
        key: '4',
        dataIndex: 'seatNumber',
        align: 'center',
    },
    {
        title: '价格基数',
        key: '5',
        dataIndex: 'priceBase',
        align: 'center',
    },
    {
        title: '适配车型',
        key: '6',
        dataIndex: 'adapter',
        align: 'center',
    },
    {
        title: '操作',
        key: '7',
        render: () => (
            <Space size="middle">
                <a>编辑</a>
                <a>删除</a>
            </Space>
        ),
        align: 'center'
    },
];

const data = [
    {
        key: '1',
        carriageNumber: '001',
        level: '豪华',
        size: '(4+4)*10',
        seatNumber: '20',
        priceBase: '8',
        adapter: '动车',
    },
];

export default class Carriage extends Component {

    state = {
        visible:false,
    }

    showModal = () => {
        this.setState({visible:true})
    }

    handleOk = () => {
        this.setState({visible:false})
    }

    handleCancel = () => {
        this.setState({visible:false})
    }

    render() {
        return (
            <div>
                <div>
                    <PageHeader
                        title={<span style={{ fontSize: '30px' }}>车厢管理</span>}
                        subTitle={<Button onClick={this.showModal} style={{ marginLeft: '20px' }}>新增</Button>}
                    />
                </div>
                <div>
                    <Table columns={columns} dataSource={data} />
                </div>
                <div>
                    <Modal title="新增车厢信息" visible={this.state.visible} onOk={this.handleOk} onCancel={this.handleCancel}>
                        <p>Some contents...</p>
                        <p>Some contents...</p>
                        <p>Some contents...</p>
                    </Modal>
                </div>
            </div>
        )
    }
}
